using namespace std;

namespace std {
	template<typename T>
	ostream& operator<<(ostream &os, vector<T> vec) {
		for (auto ele : vec)
			os << ele;
		return os;
	}

	template<typename T>
	ostream& operator<<(ostream &os, pair<T, T> p) {
		os << "(" << p.first << "," << p.second << "),";
		return os;
	}
}

class Solution {
public:
	vector<int> findSubstring(string s, vector<string>& words) {
		vector<int> rst;
		if (s.empty() || words.empty())
			return rst;
		vector<pair<int, int>> posi;
		for (int i = 0; i < s.size() - words[0].size() + 1; ++i)
			posi.emplace_back(i, i);
		sort(words.begin(), words.end());
		vector<int> used(words.size(), 0);
		findOneSubstring(words, used, posi, s, rst);
		return rst;
	}

	int sum(vector<int> &vec) {
		int sum = 0;
		for (auto ele : vec)
			sum += ele;
		return sum;
	}

	void findOneSubstring(vector<string> &words, vector<int> &used, vector<pair<int, int>> posi, string s, vector<int> &rst) {
		if (sum(used)==words.size()) {
			for (auto ele : posi) {
				rst.push_back(ele.first);
			}
			return;
		}
		for (int i=0; i<words.size(); ++i) {
			if(used[i]==0) {
				string word = words[i];
				int len = word.size();
				vector<pair<int, int>> posiExt;
				for (auto ele : posi) {
					if (ele.second + len <= s.size() && s.substr(ele.second, len) == word) {
						posiExt.emplace_back(ele.first, ele.second+ len);
					}
				}
				if (!posiExt.empty()) {
					used[i] = 1;
					findOneSubstring(words, used, posiExt, s, rst);
					used[i] = 0;
				}
				while (i < words.size() - 1 && words[i] == words[i + 1])
					++i;
			}
		}
	}
};

